import React, { Component } from 'react'

class Search extends Component{

	state = {
		text: ''
	}
	onChange = (e) => {
		e = e.target.value
	}
	render() {
		return (
			<div>
				<form className="form">
					<input 
						type="text" 
						name="text" 
						placeholder="Search Users..." 
						value=''
						onChange={this.onChange}
					/>
					<input type="submit" value="Search" className="btn btn-dark btn-block"/>
				</form>
			</div>
		)
	}
}




export default Search
